CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_mudmovement_Add`(IN mudNumber int, IN requestedBy int,IN goingAt int, IN bIsCourt BIT, IN strRcNum varchar(45), IN strSendingVia varchar(45), IN strrcCertPath varchar(450), IN strTRansfereeIdPath varchar(450), IN dSentOn date)
BEGIN
DECLARE currentlyAt INT;
DECLARE isOnMalkhana INT;
DECLARE moveId INT;
set currentlyAt = (select departmentId from mud where isActive = 1 and mudNo = mudNumber);
update mudmovement set isACtive = 0 where mudNo = mudNumber;
insert into mudmovement (mudNo,currentlyAt,requestedBy,goingAt, isCourt, rcNum, sendingVia, rcCertPath, transfereeIdPath, isActive, sentOn) values (mudNumber,currentlyAt,requestedBy,goingAt, bIsCourt,strRcNum, strSendingVia, strrcCertPath, strTRansfereeIdPath, Case isCourt when 1 then 0 else 1 end, dSentOn);
set isOnMalkhana = (select onEMalkhana from department where id = goingAt);
if (0 = bIsCourt and 0 = isOnMalkhana ) then
	SET moveId = (select id from mudmovement where mudNo = mudNumber and isActive = 1);
	call sp_accept_mudmovement(requestedBy, moveId);
end if;
END ;;
